using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// Important: UISearchDisplayController is deprecated in iOS 8. (Note that UISearchDisplayDelegate is also deprecated.) To manage the presentation of a search bar and display search results in iOS 8 and later, instead use UISearchController.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UISearchDisplayController_Class/index.html#//apple_ref/occ/cl/UISearchDisplayController"/>    [iOSVersion(3)]    [Export("")]    public class UISearchDisplayController : NSObject//, AnyObject, CVarArgType, Equatable, Hashable, NSObjectProtocol, Printable    {        public UISearchDisplayController() { }        /// <summary>        /// Returns a display controller initialized with the given search bar and contents controller.        /// </summary>        /// <param name="searchBar">A search bar.        ///   The search bar must not currently be associated with another search display controller.</param>        /// <param name="contentsController">The view controller that manages display of the original contents that are to be searched.        ///   The view controller must not currently be associated with another search display controller.</param>        [iOSVersion(3)]        public UISearchDisplayController([Unwrapped] UISearchBar searchBar, [Unwrapped] UIViewController contentsController) { }                /// <summary>        /// Displays or hides the search interface, optionally with animation.        /// </summary>        /// <param name="visible">true to display the search interface if it is not already displayed; false to hide the search interface if it is currently displayed.</param>        /// <param name="animated">true to use animation for a change in visible state, otherwise false.</param>        [iOSVersion(3)]        [Export("setActive")]        public virtual void SetActive(bool visible, bool animated) {  }                /// <summary>        /// The visibility state of the search interface.        /// </summary>        [iOSVersion(3)]        [Export("active")]        public bool Active { get; set; }                /// <summary>        /// The controller’s delegate.        /// </summary>        [iOSVersion(3)]        [Export("delegate")]        [Optional]        public UISearchDisplayDelegate Delegate { get; set; }                /// <summary>        /// The search bar. (read-only)        /// </summary>        [iOSVersion(3)]        [Export("searchBar")]        [Unwrapped]        public UISearchBar SearchBar { get; private set; }                /// <summary>        /// The view controller that manages the contents being searched. (read-only)        /// </summary>        [iOSVersion(3)]        [Export("searchContentsController")]        [Unwrapped]        public UIViewController SearchContentsController { get; private set; }                /// <summary>        /// The table view in which the search results are displayed. (read-only)        /// </summary>        [iOSVersion(3)]        [Export("searchResultsTableView")]        [Unwrapped]        public UITableView SearchResultsTableView { get; private set; }                /// <summary>        /// The data source for the table view in which the search results are displayed.        /// </summary>        [iOSVersion(3)]        [Export("searchResultsDataSource")]        [Optional]        public UITableViewDataSource SearchResultsDataSource { get; set; }                /// <summary>        /// The delegate for the table view in which the search results are displayed.        /// </summary>        [iOSVersion(3)]        [Export("searchResultsDelegate")]        [Optional]        public UITableViewDelegate SearchResultsDelegate { get; set; }                /// <summary>        /// The title for the search results view.        /// </summary>        [iOSVersion(5)]        [Export("searchResultsTitle")]        [Optional]        public string SearchResultsTitle { get; set; }                /// <summary>        /// Specifies that the navigation bar contains a search bar.        /// </summary>        [iOSVersion(7)]        [Export("displaysSearchBarInNavigationBar")]        public bool DisplaysSearchBarInNavigationBar { get; set; }                /// <summary>        /// Represents the search display controller in a navigation controller’s navigation bar. (read-only)        /// </summary>        [iOSVersion(7)]        [Export("navigationItem")]        [Unwrapped]        public UINavigationItem NavigationItem { get; private set; }    }}